content='Vitiligo ist eine Hautkrankheit. Man nennt sie auch Weißfleckenkrankheit. Bei Vitiligo verliert die Haut an manchen Stellen das braune Pigment Melanin. Das führt dazu, dass es helle Flecken auf der Haut gibt. Diese Flecken sind scharf abgegrenzt und haben keine regelmäßige Form. 

Vitiligo kann man nicht heilen, aber man kann es behandeln. Manchmal kommt Vitiligo auch zusammen mit anderen Krankheiten, die das Immunsystem betreffen, wie zum Beispiel Schilddrüsenprobleme. 

