content='Anästhesie ist ein medizinisches Verfahren. Es hilft, Schmerzen und das Bewusstsein während einer Operation oder schmerzhafter Behandlung zu kontrollieren. Dabei werden Medikamente gegeben. Diese Medikamente können dazu führen, dass man das Bewusstsein verliert, keine Schmerzen mehr spürt und die Muskeln sich entspannen. 

Es gibt verschiedene Arten von Anästhesie. Bei der Allgemeinanästhesie bekommt man Schlafmittel und Schmerzmittel. Manchmal werden auch Medikamente gegeben, die die Muskeln entspannen. Bei der Regionalanästhesie werden bestimmte Nerven in einem Körperbereich blockiert.

